import {
  Component,
  OnInit,
  Input,
  ChangeDetectorRef,
  EventEmitter,
  Output,
} from '@angular/core';
import { Observable, of } from 'rxjs';
import { ScGridColumnComponent } from '@scales-library/grid/grid-column/grid-column.component';
import { ScGridSetting } from '@scales-library/grid/grid-models/grid-column';
import { ScCheckState, ScSortDirection } from '@scales-library/grid/grid-models/enums';
import { ScGridService } from '@scales-library/grid/grid.service'
import { take } from 'rxjs/operators';

interface Activity {
  activityID: number;
  activityEntityID: number;
  activityEntityType: string;
  statusName: string;
  details: ActivityDetails[];
  summary: string;
  text: string;
  type: string;

  ownerDisplayName: string;
  dateCreatedUtc: Date;
  updatedAtUtc: Date;
  updatedBy: string;
  createdByUserID: number;
  relatedEntities: any[];
  attachments: any[];
  jobTitle: string;
  companyID?: number;
  companyName: string;
}
interface Contact {
  contactID: number;
  isCandidate: boolean;
  linkedCandidateID?: number;
  firstName: string;
  lastName: string;
  name: string;
  phone: PhoneNumber;
  mobile: PhoneNumber;
  email: string;
  otherEmail: string[];
  company: Company;
  initials: string;
  headshotUrl: string;
  headshotThumbnailUrl: string;
  excludeFromBulkEmails: boolean;
  isHiringManager: boolean;
  status: ContactStatus;
  lastUpdatedDate: string;
  recruiters: number[];
  owner?: number;
  salutation: string;
  position: string;
  reportsTo: Contact;
  address: Address;
  socialLinks: SocialLinks;
  customFields: Map<number, CustomFieldValue>;
}
interface ContactStatus {
  statusID: number;
  name: string;
  closed: boolean;
}
interface SocialLinks {
  facebookUrl: string;
  linkedInUrl: string;
  twitterUrl: string;
  googlePlusUrl: string;
  gitHubUrl: string;
  stackOverflowUrl: string;
  instagramUrl: string;
  wordPressUrl: string;
  skypeUrl: string;
  otherUrl: string;
}
interface Address {
  addressID: string;
  name: string;
  displayName: string;
  line1: string;
  line2: string;
  suburb: string;
  state: string;
  postcode: string;
  country: string;
  countryCode: string;
  phone: PhoneNumber;
  url: string;
}
interface PhoneNumber {
  formattedNumber: string;
  normalizedNumber: string;
  extension: string;
}
interface ActivityDetails {
  fieldName: string;
  textValue: string;
}
interface ColumnFilterValue {
  columnName: string;
  value: string;
}

const CandidateActivityTypeDescription: { [key: string]: string } = {
  Screening: 'Screening',
  ReferenceCheck: 'Reference Check',
  CandidateCare: 'Candidate Care',
  BackgroundCheck: 'Background Check',
  VisaWorkRights: 'Visa / Work Rights',
  Onboarding: 'Onboarding',
  Compliance: 'Compliance',
  Induction: 'Induction',
  Other: 'Other',
};
interface Company {
  companyID: number;
  name: string;
  initials: string;
  imageUrl: string;
  imageThumbnailUrl: string;
  primaryContact: Contact;
  addresses: Address[];
  remoteLookedUp: boolean;
  address: Address;
  otherAddresses: Address[];
  parentCompany: Company;
  socialLinks: SocialLinks;
  customFields: Map<number, CustomFieldValue>;
  status: Status;
  latestTerms: CompanyAttachment;
  attachments: CompanyAttachment[];
}
interface CompanyAttachment extends Attachment {
  companyID: number;
  companyAttachmentTypeGroup: CompanyAttachmentType;
}
enum CompanyAttachmentType {
  Other = 'Other',
  Terms = 'Terms',
  PaymentDetails = 'PaymentDetails',
}
interface Attachment {
  entityID: number;
  attachmentID: string;
  tempID: string;
  name: string;
  url: string;
  viewerUrl: string;
  dateUpdatedUtc?: Date;
  attachmentType: string;
  dateCreated: Date;
  expiryDate: Date;
  owner: string;
  fileSize: number;
}
interface WorkflowStage {
  stageID: number;
  displayIndex: number;
  progress: string; // possible value: inactive, started, inprogress, complete
  forecast: number;
  stage: Stage;
}

interface Workflow {
  accountID: number;
  workflowID: number;
  name: string;
  placementType: string;
  isDefault: boolean;
  stages: WorkflowStage[];
  userGroups: number[];
  userGroupNames: string[];
}
interface Stage {
  stageID: number;
  name: string;
  progress: string; // possible value: inactive, started, inprogress, complete
  displayIndex: number;
  default: boolean;
  forecast: number;
  workflowCount?: number;
  usedInWorkflows?: Workflow[];
  isDeleting?: boolean;
}
interface Status {
  statusID: number;
  name: string;
  closed: boolean;
  default: boolean;
  rejected: boolean;
  stage: Stage;
}
interface JobApplication {
  jobApplicationID: number;
  jobOrderID: number;
  jobOrderWorkflowID: number;
  jobOrderSource: string;
  placementID?: number;
  jobTitle: string;
  company?: Company;
  candidate: Candidate;
  status: Status;
  hasPlacement: boolean;
  source: string;
  searchRank: number;
  location: string;
  locationDisplayName: string;
  phone: PhoneNumber;
  mobile: PhoneNumber;
  inboundJobApplicationCount?: number;
  hasCoverLetterVideo: boolean;
  address: Address;
  idealPosition: string;
  idealSalary: WorkTypeSalary;
  owner: UserLink;
  recruiter: UserLink;
  customFields: Map<number, CustomFieldValue>;
  hasBeenViewed: boolean;
  noteSummary: NoteSummary;
  salutation: string;
  linkedInUrl: string;
  jobApplicationPopupUrl: string;
  reviewStage: string;
  rating: number;
  candidateInternalRating: string;
  dateCreated: string;
  dateUpdated: string;
  dataPolicyConsentAtUtc: string;
  partnerAction: PartnerActionStatus[];
  extensionData: any;
  checked: boolean;
  candidateRecruitersNameList: string;
  candidateRecruiters: UserLink[];
}
interface WorkTypeSalary {
  workType: WorkType;
  salary: Salary;
}
interface WorkType {
  workTypeID: number;
  name: string;
  salaryType: SalaryType;
  placementType: PlacementType;
}
enum SalaryType {
  NotSpecified = 'NotSpecified',
  PerHour = 'PerHour',
  PerDay = 'PerDay',
  PerWeek = 'PerWeek',
  PerMonth = 'PerMonth',
  PerYear = 'PerYear',
}
enum PlacementType {
  Permanent = 'Permanent',
  Contract = 'Contract',
  Temporary = 'Temporary',
  Credit = 'Credit',
}
const SalaryTypeDescription: { [key: string]: string } = {
  PerHour: 'Hourly Rate',
  PerDay: 'Daily Rate',
  PerWeek: 'Weekly Rate',
  PerMonth: 'Monthly Rate',
  PerYear: 'Annual Salary',
};
interface Salary {
  type: SalaryType;
  salaryRange: string;
  salaryMin?: number;
  salaryMax?: number;
  unitPerUnit: number;
  chargeRate: number;
}
interface StartDate {
  type: StartDateType;
  date: Date;
}
enum StartDateType {
  NotSpecified = 'NotSpecified',
  DateSpecified = 'DateSpecified',
  Immediate = 'Immediate',
  In1Week = 'In1Week',
  In2Weeks = 'In2Weeks',
  In3Weeks = 'In3Weeks',
  In4Weeks = 'In4Weeks',
  In1Month = 'In1Month',
  In2Months = 'In2Months',
  In3Months = 'In3Months',
  In4Months = 'In4Months',
  In5Months = 'In5Months',
  In6Months = 'In6Months',
}
const AccountFeatures = {
  email: 'email',
  sms: 'sms',
  jobOrders: 'jobOrders',
  folders: 'folders',
  jobApplications: 'jobApplications',
  candidates: 'candidates',
  candidateAttachments: 'candidateAttachments',
  candidateSkills: 'candidateSkills',
  candidateSubmissions: 'candidateSubmissions',
  candidateSubmissionComments: 'candidateSubmissionComments',
  placements: 'placements',
  companies: 'companies',
  contacts: 'contacts',
  skills: 'skills',
  careerUpdate: 'careerUpdate',
  seekTSC: 'seekTSC',
  subCategory: 'subCategory',
  ratesAdder: 'ratesAdder',
};
enum FieldType {
  Text,
  List,
  Date,
  Lookup,
  Url,
}
class PartnerMenuActionItem {
  actionID: string;
  name: string;
  activeOnly: boolean;
  approvedOnly: boolean;
  url: string;
  urlType: string;
  status: number[];
  enabled: boolean;
}
class PartnerMenuAction {
  partnerID: number;
  menuName: string;
  columnName: string;
  actions: PartnerMenuActionItem[];
}
interface CustomFieldName {
  fieldID: number;
  name: string;
  fieldType: FieldType;
  isMultiValue: boolean;
  isDate: boolean;
  isUrl: boolean;
  isList: boolean;
  possibleValues: string[];
  mandatory: boolean;
  maximumLength: number;
}
const StartDateTypeDescription: { [key: string]: string } = {
  NotSpecified: '',
  DateSpecified: 'Select a Date',
  Immediate: 'Immediate',
  In1Week: '1 Week',
  In2Weeks: '2 Weeks',
  In3Weeks: '3 Weeks',
  In4Weeks: '4 Weeks',
  In1Month: '1 Month',
  In2Months: '2 Months',
  In3Months: '3 Months',
  In4Months: '4 Months',
  In5Months: '5 Months',
  In6Months: '6 Months',
};
interface Candidate {
  candidateID: number;
  name: string;
  firstName: string;
  lastName: string;
  salutation: string;
  phone: PhoneNumber;
  mobile: PhoneNumber;
  email: string;
  otherEmail: string[];
  address: Address;

  currentPosition: string;
  currentEmployer: string;
  currentSalary: WorkTypeSalary;
  availability: StartDate;

  idealPosition: string;
  idealSalary: WorkTypeSalary;
  otherSalaries: WorkTypeSalary[];

  recruiters: number[];
  socialLinks: SocialLinks;
  headshotThumbnailUrl: string;
  headshotUrl: string;
  initials: string;
  rank: number;

  resume: Attachment;
  formattedResume: Attachment;
  coverLetter: Attachment;
  internalRating: string;
  source: string;
  customFields: { [key: string]: CustomFieldValue };
  excludeFromBulkEmails: boolean;
  status: Status;
  remoteLookedUp: boolean;

  dateOfBirth: Date;
  emergencyContactName: string;
  emergencyContactNumber: string;
  dateResumeUpdated: string;

  linkedContactID: number;

  lastPlaced: string;
  seeking: CandidateSeeking;

  isPayrollLookups: boolean;
  payrollOffice: string;
  payrollSkillGroup: string;
  payrollPosition: string;
}
interface CandidateSeeking {
  status: CandidateSeekingStatus;
  dateUpdatedUtc: string;
}
enum CandidateSeekingStatus {
  Yes = 'Yes',
  Maybe = 'Maybe',
  No = 'No',
}

const CandidateSeekingStatusDescription: { [key: string]: string } = {
  Yes: 'Actively Looking',
  Maybe: 'Open to Opportunities',
  No: 'Not Interested',
};
interface UserLink extends PersonName {
  userID: number;
  displayName: string;
  mentionName: string;
  email: string;
  initials: string;
  headshotUrl: string;
  deleted: boolean;
  fullName: string;
}
interface PersonName {
  firstName: string;
  lastName: string;
  fullName: string;
}
interface PartnerActionStatus {
  partnerID: number;
  stage: string;
  stageText: string;
  status: string;
  updated: string;
  result: PartnerActionResult;
}
interface PartnerActionResult {
  url: string;
  urlPopup: boolean;
}
interface NoteSummary {
  noteType: string;
  dateCreatedUtc: Date;
}
interface CustomFieldValue {
  fieldID: number;
  value?: string;
  valueList?: string[];
}

@Component({
  selector: 'nz-demo-grid-select',
  template: `
    <div
      class="manage-column"
      [(nzPopoverVisible)]="applicationsTableColumnSettingVisible"
      nz-popover
      nzPopoverTrigger="click"
      nzPopoverPlacement="bottomRight"
      [nzPopoverContent]="manageApplicationTableColumns"
    >
      <i class="app-icon icon-primary" nz-icon nzType="ja:setting"></i>
    </div>

    <ng-template #manageApplicationTableColumns>
      <ng-container *ngIf="allColumns$ | async as allColumns">
        <sc-grid-manage-column
          [scAllColumns]="allColumns"
          (scClose)="applicationsTableColumnSettingVisible = false"
          (scReset)="resetApplicationTableSettings()"
          (scSave)="saveApplicationTableSettings($event)"
        ></sc-grid-manage-column>
      </ng-container>
    </ng-template>

    <sc-grid
      [scGridData]="applications"
      [scGridSetting]="cGridSettings"
      [scGridName]="tableName"
      [scActiveID]="cActiveID"
      [scCanUserSelectColumn]="fullView"
      [scIsFitToParent]="!fullView"
      [scShowInlineCheckAll]="true"
      [scPageSize]="20"
      [scPageIndex]="pageIndex"
      [scTotalCount]="totalCount"
      [scGrayTextIDs]="cGrayTextIDs"
      scIdPropertyName="jobApplicationID"
      [scSelectedIDs]="$any(selectedIDs$ | async)"
      [scSearchKeyword]="searchKeyword"
      [scLoading]="$any(loading$ | async)"
      (scCheckAllStateChange)="checkAllStateChange.emit($event)"
      [scResetSelectionOnSearch]="true"
      (scFilterChange)="columnSearchChange($event)"
      (scCheckedChange)="onCheckedChange($event)"
      (scRawColumnsUpdated)="onRawColumns($event)"
      (scSortChange)="onSortChange($event)"
      (scPageChange)="onPageChange($event)"
      (scPageSizeChange)="onPageSizeChange($event)"
    >
      <sc-grid-column
        scHeader="Job title"
        scBinding="jobTitle"
        scLeft="48px"
        [scScaleWidth]="4"
        [scCanSearchColumn]="true"
      >
        <ng-template let-item="item">
          <a [href]="'joborders/' + item.jobOrderID">{{ item.jobTitle }}</a>
        </ng-template>
      </sc-grid-column>

      <sc-grid-column scHeader="Company" scBinding="company.name" [scScaleWidth]="3" [scCanSearchColumn]="true">
        <ng-template let-item="item">
          <a [href]="'companies/' + item.company?.companyID">{{ item.company?.name }}</a>
        </ng-template>
      </sc-grid-column>

      <sc-grid-column
        scHeader="Contact"
        scBinding="company.primaryContact.name"
        [scScaleWidth]="3"
        [scCanSearchColumn]="true"
        [scDisplay]="fullView"
      >
        <ng-template let-item="item">
          <a [href]="'contacts/' + item.company?.primaryContact?.contactID">{{ item.company?.primaryContact?.name }}</a>
        </ng-template>
      </sc-grid-column>
      <sc-grid-column scHeader="Status" scBinding="status.name" [scScaleWidth]="3" scSortKey="status.name">
        <ng-template let-item="item">
          <a class="ellipsis" nz-dropdown nzTrigger="click" (nzVisibleChange)="statusSelectOpen($event, item)">
            <!--      <app-status-doughnut
            [content]="item?.status?.name"
            [displayDoughnut]="item?.status?.stage !== null"
            [progress]="item?.status?.stage?.progress"
          ></app-status-doughnut> -->
          </a>
        </ng-template>
      </sc-grid-column>
      <sc-grid-column
        scHeader="Location"
        scBinding="locationDisplayName"
        [scScaleWidth]="3"
        [scCanSearchColumn]="true"
        [scDisplay]="fullView"
      >
      </sc-grid-column>
      <sc-grid-column
        scHeader="Source"
        scBinding="source"
        [scScaleWidth]="2"
        scSortKey="source"
        [scCanSearchColumn]="true"
        [scDisplay]="fullView"
      ></sc-grid-column>
      <sc-grid-column scHeader="Owner" scBinding="owner.displayName" [scFixedWidth]="120" [scCanSearchColumn]="true">
      </sc-grid-column>
      <sc-grid-column
        scHeader="Applied"
        scBinding="dateCreated"
        scDataType="dateTime"
        [scDefaultSort]="ScSortDirection.Descend"
        [scFixedWidth]="120"
      >
      </sc-grid-column>

      <sc-grid-column
        scHeader="Stage"
        scBinding="status.stage.name"
        [scScaleWidth]="3"
        [scDefaultSort]="ScSortDirection.Descend"
        [scDisplay]="fullView"
      >
        <ng-template let-item="item">
          <div *ngIf="item?.status?.stage" class="stage">
            <i class="fa fa-circle {{ item.status.stage.progress }}-stage" aria-hidden="true"></i
            >{{ item.status.stage.name }}
          </div>
        </ng-template>
      </sc-grid-column>

      <sc-grid-column
        scHeader="Video"
        scBinding="hasCoverLetterVideo"
        [scFixedWidth]="80"
        [scDefaultSort]="ScSortDirection.Descend"
        [scDisplay]="fullView"
      >
        <ng-template let-item="item">
          <i *ngIf="item.hasCoverLetterVideo" class="fa fa-check" aria-hidden="true"></i>
        </ng-template>
      </sc-grid-column>
      <sc-grid-column
        scHeader="Apps"
        scBinding="inboundJobApplicationCount"
        [scDefaultSort]="ScSortDirection.Descend"
        [scFixedWidth]="80"
        [scDisplay]="fullView"
      ></sc-grid-column>
      <sc-grid-column
        scHeader="Rank"
        scBinding="searchRank"
        [scDefaultSort]="ScSortDirection.Descend"
        [scFixedWidth]="80"
        [scDisplay]="fullView"
      ></sc-grid-column>
      <sc-grid-column
        scHeader="SEEK Screen"
        scBinding="extensionData.seekScreeningScore"
        [scDefaultSort]="ScSortDirection.Descend"
        [scFixedWidth]="125"
        [scDisplay]="fullView"
      >
        <ng-template let-item="item">
          <a
            class="seek-screen"
            [attr.data-jobApplicationID]="item.jobApplicationID"
            *ngIf="item.extensionData && item.extensionData.seekScreeningScore"
          >
            {{ (+item.extensionData.seekScreeningScore).toFixed(0) }}%
          </a>
        </ng-template>
      </sc-grid-column>

      <sc-grid-column
        scHeader="APP. Rating"
        scBinding="rating"
        [scDefaultSort]="ScSortDirection.Descend"
        [scFixedWidth]="120"
        [scDisplay]="fullView"
      >
        <ng-template let-item="item">
          <nz-rate
            class="app-rate"
            [nzCharacter]="characterIcon"
            [ngModel]="item.rating / 2"
            nzAllowHalf
            (ngModelChange)="updateRating($event, item)"
          ></nz-rate>
          <ng-template #characterIcon>
            <i class="app-icon star" nz-icon nzType="ja:star"></i>
          </ng-template>
        </ng-template>
      </sc-grid-column>
      <sc-grid-column
        scHeader="Updated"
        scBinding="dateUpdated"
        scDataType="dateTime"
        [scDefaultSort]="ScSortDirection.Descend"
        [scFixedWidth]="120"
        [scDisplay]="fullView"
      >
      </sc-grid-column>
      <sc-grid-column
        *ngFor="let customField of customFields$ | async"
        [scHeader]="customField.name"
        scBinding="customFields.{{ customField.fieldID }}"
        [scDataType]="customField.fieldType === FieldType.Date ? 'date' : 'string'"
        [scCanSort]="customField.fieldType !== FieldType.Date"
        [scDisplay]="false"
        [scScaleWidth]="2"
      >
      </sc-grid-column>
      <sc-grid-column
        scHeader="Data Consent"
        scBinding="DataPolicyConsentAtUtc"
        scDataType="dateTime"
        [scDisplay]="false"
        [scFixedWidth]="175"
      >
      </sc-grid-column>
      <sc-grid-column
        scHeader="Job ID"
        scBinding="jobOrderID"
        [scDisplay]="false"
        [scDefaultSort]="ScSortDirection.Descend"
        [scFixedWidth]="135"
        [scCanSearchColumn]="true"
      >
        <ng-template let-item="item">
          <a [href]="'joborders/' + item.jobOrderID">{{ item.jobOrderID }}</a>
        </ng-template>
      </sc-grid-column>
      <sc-grid-column
        scHeader="App. ID"
        scBinding="jobApplicationID"
        [scDisplay]="false"
        [scDefaultSort]="ScSortDirection.Descend"
        [scFixedWidth]="135"
        [scCanSearchColumn]="true"
      ></sc-grid-column>
      <sc-grid-column
        scHeader="Added By"
        scBinding="recruiter.displayName"
        [scDisplay]="false"
        [scScaleWidth]="3"
        [scCanSearchColumn]="true"
      ></sc-grid-column>
      <sc-grid-column
        scHeader="Country"
        scBinding="address.country"
        [scDisplay]="false"
        [scScaleWidth]="3"
        [scCanSearchColumn]="true"
      ></sc-grid-column>
      <sc-grid-column
        scHeader="Ideal Position"
        scBinding="idealPosition"
        [scDisplay]="false"
        [scScaleWidth]="3"
      ></sc-grid-column>
      <sc-grid-column
        scHeader="Ideal Salary"
        scBinding="idealSalary.salary"
        [scDisplay]="false"
        [scScaleWidth]="3"
      ></sc-grid-column>
      <sc-grid-column
        scHeader="Ideal Work Type"
        scBinding="idealSalary.workType"
        [scScaleWidth]="3"
        [scDisplay]="fullView"
      ></sc-grid-column>
      <sc-grid-column
        scHeader="Salutation"
        scBinding="salutation"
        [scDisplay]="false"
        [scFixedWidth]="120"
      ></sc-grid-column>

      <sc-grid-column scHeader="Review" scBinding="reviewStage" [scDisplay]="false" [scScaleWidth]="2"></sc-grid-column>
      <sc-grid-column
        scHeader="Last Note Type"
        scBinding="noteSummary.noteType"
        [scDisplay]="false"
        [scScaleWidth]="2"
      ></sc-grid-column>
      <sc-grid-column
        scHeader="Last Note Date"
        scBinding="noteSummary.dateCreatedUtc"
        scDataType="dateTime"
        [scDisplay]="false"
        [scScaleWidth]="2"
      ></sc-grid-column>
      <sc-grid-column
        *ngFor="let partner of partnerActions"
        [scHeader]="partner.columnName"
        scBinding="partnerAction"
        [scDisplay]="false"
        [scScaleWidth]="2"
      >
        <ng-template let-item="item"> </ng-template>
      </sc-grid-column>
      <sc-grid-column scHeader="" scRight="0" [scFixedWidth]="48">
        <ng-template let-item="item">
          <span
            nz-tooltip
            nzTooltipTitle="View Application"
            class="job-title-drawer-grid identity-column clickable"
            [attr.data-item-id]="item?.jobApplicationID"
            [attr.data-popup-url]="'/jobapplications/' + item.jobApplicationID + '/popup?defaultTab=savedtab'"
          >
            <i nz-icon nzType="right"></i>
          </span>
        </ng-template>
      </sc-grid-column>
    </sc-grid>
  `,
  styles: [`
    .manage-column {
      background-color: white;
      display: flex;
      justify-content: center;
      align-items: center;
      border: 1px solid #ccd0d9;
      cursor: pointer;
      border-radius: 3px;
      height: 32px;
      width: 40px;
      margin-left: auto;
    }
  `]
})
export class NzDemoGridSelectComponent implements OnInit {
  @Input() fullView: boolean;
  @Input() searchKeyword: string = 'highlight';
  @Input() activeRowID: number;

  @Output() activeRowChange = new EventEmitter<number>();
  @Output() checkAllStateChange = new EventEmitter<ScCheckState>();

  applications: any[];

  columns: ScGridColumnComponent[] = [];
  columnFilters: ColumnFilterValue[];
  pageIndex = 1;
  pageSize: number;
  sortKey: string;
  sortDirection: string;
  defaultSortKey = 'updatedDate';
  defaultSortDirection = ScSortDirection.Descend;
  totalCount: number;

  tableName = 'applicationsTable';

  ScSortDirection = ScSortDirection;
  cGridSettings: ScGridSetting;
  selectedIDs$: Observable<number[]>;
  cActiveID: string | number = '';
  cGrayTextIDs: (string | number)[] = [];
  aGridSettings: ScGridSetting;
  applicationsTableColumnSettingVisible: boolean;

  allColumns$: Observable<ScGridColumnComponent[]>;
  activityAllColumn$: Observable<ScGridColumnComponent[]>;

  constructor(
    private cdRef: ChangeDetectorRef,
    private gridService: ScGridService
  ) {}

  ngOnInit(): void {
    this.fullView = true;
    this.selectedIDs$ = of([9537426, 9537425]);
    this.cActiveID = 9537427;
    this.cGrayTextIDs = [9537615, 9537610];

